(62, 'Auditoria  de  mquina', 'Carregamento  de  Gs', 'Inspeo de equipamento eltrico', 'Condio de aterramento da rede eltrica.Sem deteriorao calor nos fios e conexes\r\nNenhum dano, tais como marcas de arame, tampa do peeling\r\nVrios condies de operao S / W\r\n(Nenhum conserto forado e uso incorreto)\r\nSegurana S/W alterada deve estar trabalhando adequadamente e no ser usada de modo incorreto.\r\n\r\n', 'S'),
(63, 'Auditoria  de  mquina', 'Carregamento  de  Gs', 'Listas de verificao de gesto das instalaes e vrios anexos', 'Verificao deve ser conduzida pelo padro e registrar o resultado de verificao\r\nAnexos no devem ter danos, poluio.\r\n\r\n', 'S'),
(64, 'Auditoria  de  mquina', 'LQC', 'Condio de operao normal de vrios dispositivos de energia', 'Condio de aterramento da linha de energia\r\nSem deteriorao de calor nos fios e conexes,Sem dano, como fios marcados, tampas descascadas\r\nCondio de operao S / W alterada.(Sem conserto forado e uso incorreto)\r\nSegurana S / W variada deve ser trabalhada adequadamente e no usada de modo incorreta', 'S'),
(65, 'Auditoria  de  mquina', 'LQC', 'Inspeo de equipamento eltrico', 'Condio de aterramento da linha de energia\r\nSem deteriorao de calor nos fios e conexes\r\nSem dano, como fios marcados, tampas descascadas\r\nCondio de operao S / W variada\r\n(Sem conserto forado e uso anormal)\r\nSegurana S / W variada deve ser trabalhada adequadamente e no usada de modo incorreto', 'S'),
(66, 'Auditoria  de  mquina', 'LQC', 'Verificar os pneumticos', 'Sem vazamento do tubo, vlvulas de controle, etc. e deve ser fixado.\r\nSem vazamento, desgaste, danos em todas as unidades de acionamento.\r\nSem deformao nas peas consertadas devido folga.\r\nSilenciador deve ser instalado no sistema de ventilao de ar.', 'S'),
(67, 'Auditoria  de  mquina', 'LQC', 'Listas de verificao de gesto das instalaes e vrios anexos', 'Verificao deve ser conduzida pelo padro e registrar o resultado da verificao.\r\nAnexos no podem ter dano, poluio.', 'S'),
(68, 'Auditoria  de  mquina', 'Soldagem', 'Operao normal, a presena ou ausncia  de vrios dispositivos energizados.', 'Checar condio de lubrificao de vrias unidades de acionamento\r\n(Sem folga, desgaste anormal, rudo, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) no devem ficar solta\r\nDispositivo de proteo das peas de rotao deve ser ajustado\r\nUnidade de rotao deve ser mantida limpa (Sem sujeira, peas variadas, etc).\r\n', 'S'),
(69, 'Auditoria  de  mquina', 'Soldagem', 'Inspeo de equipamento eltrico', 'Checar condio de lubrificao de vrias unidades de acionamento\r\n(Sem folga, desgaste irregular, rudo, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) no deve ficar solta\r\nDispositivo de proteo das peas de rotao deve ser ajustado\r\nUnidade de rotao deve ser mantida limpa . (Sem sujeira, peas variadas, etc).\r\n', 'S'),
(70, 'Auditoria  de  mquina', 'Soldagem', 'Checar os pneumticos', 'Sem vazamento do tubo, vlvulas de controle, etc. e deve ser fixado\r\nSem vazamento, desgaste, danos em todas as unidades de acionamento\r\nSem deformao nas peas consertadas devido folga\r\nSilenciador deve ser instalado no sistema de ventilao de ar\r\n\r\n', 'S'),
(71, 'Auditoria  de  mquina', 'Soldagem', 'Verificao da unidade de grampo', 'Sem defeito da unidade deficiente de Grampo\r\n\r\n', 'S'),
(72, 'Auditoria  de  mquina', 'Soldagem', 'Listas de verificao de gesto das instalaes e vrios anexos', 'Verificao deve ser conduzida pelo padro e registrar o resultado da verificao\r\nAnexos no podem ter dano, poluio.', 'S'),
(73, 'Auditoria  de  mquina', 'Embalagem', 'Operao normal, a presena ou ausncia  de vrios dispositivos energizados', 'Checar condio de lubrificao de vrias unidades de acionamento\r\n(Sem folga, desgaste anormal, rudo, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) no deve ficar solta\r\nDispositivo de proteo das peas de rotao deve ser ajustado\r\nUnidade de rotao deve ser mantida limpa . (Sem sujeira, peas variadas, etc)\r\n', 'S'),
(74, 'Auditoria  de  mquina', 'Embalagem', 'Inspeo de equipamento eltrico', 'Condio de aterramento da linha de fora\r\nSem deteriorao de calor nos fios e conexes\r\nSem dano, como fios marcados, tampas descascadas\r\nCondio de operao S / W variada\r\n(Sem conserto forado e uso anormal)\r\nSegurana S / W variada deve ser trabalhada adequadamente e no usada de modo errado', 'S'),
