(25, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Sensibilidade do Testador de Vazamento', 'Verificar a condio de escrita  da Folha de Verificao CTP\r\nGs: Dados principais do gs  3.2g/Y HE : 2.0 X E-5 Mbarl /Seg\r\n', 'D'),
(26, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Sensibilidade do Testador de Vazamento', 'Checar condio dos instrumentos da lista de verificao', 'D'),
(27, 'Auditoria de ciclo', 'Testador de  Vazamento', 'Quantidade de gs', 'Especificao da quantidade de gs [Teste de auditoria],Comparar a folha de verificao de manufatura & Dados de medio de auditoria', 'D'),
(28, '6 Ferramentas', 'ESD', 'Traje de eletricidade antiesttica(Pulseira Fool proof)', 'Checar pulseira, tornozeleira, traje antiesttico e  linha para se no usar o equipamento antiesttico/medio placa sus/cortina esd/corrente carros', 'D'),
(29, '6 Ferramentas', 'LQC', 'Suporte de teste de tenso / Teste de continuidade de Terra', 'Checar especificao de medio de dados definidos \r\n- Tenso de suporte: AC 1000 V / 10mA / 1s\r\n- Isolamento: DC 500V / 25M / 1s\r\n- Continuidade de terra: 25A / 0.2 / 1s\r\n(padro 0.1 + resistncia de linha 0.1)\r\n', 'D'),
(30, '6 Ferramentas', 'LQC', 'Teste de fuga de corrente', 'Checar especificao de medio de dados definidos\r\n- Liga/Desliga (On/Off) : 0.75mA \r\n- Inversor: 1.0mA/kW (Max 5mA)\r\n', 'D'),
(31, '6 Ferramentas', 'LQC', 'Instrumentos definidos em LQC', 'Condio de operao dos instrumentos definidos em LQC  (Atualizao de folha de verificao)', 'S'),
(32, '6 Ferramentas', 'Aparncia', 'Etiqueta BOX & Faixa PP', 'Fixao de etiqueta & condio de fixao da faixa PP (checar 1 plete por linha)\r\n- Etiqueta desalinhada, danificada, com falha (Gap)( faixa PP ~ Etiqueta)', 'D'),
(33, '6 Ferramentas', 'Aparncia', 'Etiqueta correspondente', 'A linha para se NG (verificao de falta & uso incorreto)\r\n- Qualidade, etiqueta de energia (Stand by), etc.', 'D'),
(34, '6 Ferramentas', 'Aparncia', 'Acessrio correto', 'Linha para caso NG (verificao de falta & uso incorreto)', 'D'),
(35, '6 Ferramentas', 'CTQ/CTP', 'Vlvula de bloqueio de torque LQC SVC ', 'Especificao de Torque & atualizao da folha  de verificao (10ea / semana)\r\n- 6.35 : 70+20 kgfcm      9.52 : 90+30 kgfcm\r\n- 12.7 : 110+30 Kgfcm    15.88 : 130+30 kgfcm\r\n', 'D'),
(36, '6 Ferramentas', 'CTQ/CTP', 'Vlvula de bloqueio de torque LQC SVC ', 'Atualizao da folha de verificao', 'S'),
(37, '6 Ferramentas', 'Verificao de Tempo', 'Verificao da faixa PP (adeso)', 'Atualizao da folha de verificao', 'S'),
(38, '6 Ferramentas', 'Auditoria - Q', 'Uso incorreto de pea', 'Verificar placa de mudana de modelo', 'D'),
(39, '6 Ferramentas', 'Auditoria - Q', 'Jig de verificao de gap CFF', 'Verificar se linha para se no usar o jig CFF', 'D'),
(40, '6 Ferramentas', 'Auto&Sequncia', 'Inspeo Auto & Seqencial', 'Verificar se quadro de avisos est atualizado(teia)\r\n', 'D'),
(41, '6 Ferramentas', 'OS&D', 'OS&D armazenamento & etiqueta', 'Manter peas OS&D na bancada durante no Maximo dia e colar etiqueta de identificao', 'D'),
(42, '6 Ferramentas', 'Reunio da qualidade', 'Reunio de reviso de qualidade de meio-dia', 'Verificar maior defeito do dia anterior(avisar na reunio)', 'D'),
(43, 'Cumprimento  do trabalho', '4M', 'Pessoa', 'Relatrio de mudana 4M do processo principal & lista de treinamento educacional (Processo principal: Soldagem forte,Carregamento,Vedao, Vazamento, Fiao)\r\n', 'S'),
(44, 'Cumprimento  do trabalho', 'Padro de Trabalho', 'Manual de instruo de trabalho / Esquema de processo QC', 'Manter condio na linha (baseado na farramenta de produo atual)', 'S'),
(45, 'Cumprimento  do trabalho', 'Padro de Trabalho', 'Manual de inspeo', 'Manter condio na linha (Nova ferramenta de produo)', 'S'),
(46, 'Segurana', 'Epi\'s', 'Layout das luvas', 'Usar os epi\'s de acordo com a instruo de trabalho em cada posto', 'S'),
(47, 'Auditoria  de  mquina', 'Mquina  de  dobrar EVA/Cond', 'Condio de operao normal de vrios dispositivos de energia', 'Checar condio de lubrificao de vrias unidades de acionamento.\r\n(Nada solto, traje anormal, rudo, calor, etc )\r\n', 'S'),
(48, 'Auditoria  de  mquina', 'Mquina  de  dobrar EVA/Cond', 'Inspeo de equipamentos eltricos', 'Condio de aterramento da Linha de Fora\r\nNenhuma deteriorao de calor em fios e conexes\r\nNenhum dano, como marcas nos fios, tampas descascando\r\n', 'S'),
(49, 'Auditoria  de  mquina', 'Mquina  de  dobrar EVA/Cond', ' Dispositivo verificao de leo pneumtico', 'Sem vazamento do tubo, controle de vlvulas,  etc. e deve ser consertado.\r\nSem vazamento, desgaste, danos em todas as unidades de conduo.\r\n\r\n', 'S'),
(50, 'Auditoria  de  mquina', 'Mquina  de  dobrar EVA/Cond', 'Listas de verificao de gerenciamento  de equipamento e vrios anexos', 'Listas de verificao de gerenciamento de equipamento e vrios anexos\r\n', 'S'),
(51, 'Auditoria  de  mquina', 'Linha  de  vcuo', 'Operao normal de vrios dispositivos de energia', 'Sem folga, desgaste anormal, rudo, calor, etc', 'S'),
(52, 'Auditoria  de  mquina', 'Linha  de  vcuo', 'Verificao do suprimento de energia', 'Sem dano no suprimento de energia. Mant-lo limpo', 'S'),
(53, 'Auditoria  de  mquina', 'Linha  de  vcuo', 'Verificao da gesto de bomba de vcuo (leo,Filtro,Mangueira, etc.)', 'Lubrificante (leo por vcuo) no deve estar com a cor diferente devido poluio e deteriorao,\r\nSem vazamento do corpo da unidade,lubrificante manter os nveis do padro.\r\nFiltro na linha no est contaminado.', 'S'),
(54, 'Auditoria  de  mquina', 'Linha  de  vcuo', 'Listas de verificao de gesto  de equipamento e vrios anexos', 'Verificao deve ser conduzida pelo padro e registrar o resultado da verificao,anexos no devem ter danos, poluio.\r\n', 'S'),
(55, 'Auditoria  de  mquina', 'Linha  Principal', 'Condio normal de operao  de vrios dispositivos de energia', 'Checar condio de lubrificao de vrias unidades de acionamento\r\n(Sem folga, desgaste anormal, rudo, calor, etc )\r\nCada unidade de acionamento (cinto, cadeia) no deve ficar solta\r\nDispositivo de proteo das peas de rotao deve ser ajustado\r\nUnidade de rotao deve ser mantida limpa (Sem sujeira, peas variadas, etc)\r\n\r\n', 'S'),
(56, 'Auditoria  de  mquina', 'Linha  Principal', 'Inspeo de equipamento eltrico', 'Condio de aterramento da linha de energia.\r\nSem deteriorao de calor nos fios e conexes.\r\nSem dano, como fios marcados, tampas descascadas.\r\nCondio de operao S / W variada.(Sem conserto forado e uso anormal)\r\nSegurana S / W variada deve ser trabalhada adequadamente e no usada de modo anormal.\r\n\r\n\r\n', 'S'),
(57, 'Auditoria  de  mquina', 'Linha  Principal', 'leo, verificao de pneumticos', 'Sem vazamento do tubo, vlvulas de controle, etc. e deve ser fixado.Sem vazamento,\r\n desgaste, danos em todas as unidades de acionamento.Sem deformao nas peas \r\nconsertadas devido folga,deve ser instalado o silenciador no sistema de ventilao de ar.\r\n\r\n\r\n', 'S'),
(58, 'Auditoria  de  mquina', 'Linha  Principal', 'Listas de verificao de gesto das instalaes e vrios anexos', 'Verificao deve ser conduzida pelo padro e registrar o resultado da verificao,anexos no podem ter dano, poluio\r\n\r\n\r\n\r\n', 'S'),
(59, 'Auditoria  de  mquina', 'Carregamento  de  Gs', 'Verificao da gesto da bomba de vcuo  (leo,Filtro,Mangueira, etc.)', 'Lubrificante (leo por vcuo) no deve estar com a cor alterada por poluio e deteriorao\r\nSem vazamento do corpo da unidade\r\nLubrificante deve manter os nveis do padro\r\nFiltro na linha no deve estar contaminado\r\nMedidor de vcuo deve ser mantido no nvel normal\r\n\r\n\r\n\r\n', 'S'),
(60, 'Auditoria  de  mquina', 'Carregamento  de  Gs', 'Verificao de leo de dispositivo pneumtico.', 'Nenhum vazamento do tubo, vlvulas de controle, etc. e precisam ser consertados\r\nNenhuma vazamento, desgaste, danos em todas as unidades de acionamento\r\nNenhuma deformao nas peas consertadas devido folgas\r\nSilenciador deve ser instalado no sistema de ventilao de ar\r\n\r\n\r\n\r\n', 'S'),
(61, 'Auditoria  de  mquina', 'Carregamento  de  Gs', 'Verificao do sistema de refrigerao', 'Nenhum bloqueio no filtro na linha(A lacuna entre medidor de presso do lado do suprimento   2 ~ 3 /  dentro dos dias),Presso do suprimento de gs deve atender ao padro.INSERT INTO `line_audit_results` (`id`, `id_auditoria`, `id_checklist`, `result`, `foto`, `obs`) VALUES
